import React, {Component} from 'react';

class Main extends Component {

    render () {
        return (
            <div id='content' className='mt-3'>
                <table className='table text-muted'>
                    <thead>
                    <tr>
                        <th></th>
                        <th></th>
                    </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td></td>
                            <td></td>
                        </tr>
                    </tbody>
                </table>
            </div>
        )
    }
}

export default Main;
